const Signup = () => {
    return ( 
        <div className="signup">
            <h1>SignUP</h1>
            <div className="forms" class="d-block">
                <input class="form-control form-control-lg w-25" type="text"  placeholder="Your Name"/>
                <input class="form-control w-25" type="email"placeholder="Your email"/>
                <input class="form-control w-25" type="password"placeholder="Ypour email"/>
                <input class="form-control w-25"type="password"placeholder="Repeat Your Password"/>
                <input class="form-control w"type="checkbox" /> <label htmlFor="t&c">I agree all the terms and conditions</label>
                <button>Register</button>
            </div>
            <div className="image">
                <img src="" alt="" />
            </div>
        </div>
     );
}

export default Signup;
